import { useEffect } from "react";

export default function TestKraken() {
    useEffect(() => {
        const ws = new WebSocket("wss://ws.kraken.com/v2");

        ws.onopen = () => {
            console.log("‚úÖ Connected to Kraken v2");

            ws.send(JSON.stringify({
                event: "subscribe",
                pair: ["XBT/USD", "ETH/USD", "ADA/USD"], // –¢–µ—Å—Ç–æ–≤–∏ —Å–∏–º–≤–æ–ª–∏
                subscription: { name: "ticker" }
            }));
        };

        ws.onmessage = (event) => {
            console.log("üì© RAW:", event.data);
        };

        ws.onclose = () => {
            console.log("‚ùå Disconnected from Kraken v2");
        };

        return () => ws.close();
    }, []);

    return null; // –Ω—è–º–∞ UI
}
